import React from 'react';

const BalancePage = () => {
  return (
    <div className="balance-page">
      <h2>보유자산</h2>
      <div className="balance-content">
        <p>아직 거래 내역이 없습니다.</p>
      </div>
    </div>
  );
};

export default BalancePage;
